# 麻雀牌
class Tile():
    IMAGE_W = 50
    IMAGE_H = 70

    def __init__(self, tile_id):
        self.__tile_id = tile_id
        self.__layer = -1
        self.__pos = (-1, -1)   # (row, column)
        self.__x = -100
        self.__y = -100
        self.__selected = False
        self.__visible = True
        self.__img_id = -1

    def __eq__(self, other):
        if other is None:
            ret = False
        else:
            ret = (self.tile_id == other.tile_id)
        return ret

    def __lt__(self, other):
        self_val = (self.__layer * 10000) + (self.__pos[0] * 100) + self.__pos[1]
        other_val = (other.__layer * 10000) + (other.__pos[0] * 100) + other.__pos[1]
        return (self_val < other_val)

    @property
    def tile_id(self):
        return self.__tile_id

    @property
    def layer(self):
        return self.__layer

    @property
    def pos(self):
        return self.__pos

    @property
    def xy(self):
        if self.visible:
            return (self.__x, self.__y)
        else:
            return (self.IMAGE_W * -2, self.IMAGE_H * -2)

    @property
    def selected(self):
        return self.__selected

    @selected.setter
    def selected(self, selected):
        self.__selected = selected

    @property
    def visible(self):
        return self.__visible

    @visible.setter
    def visible(self, visible):
        if visible == False:
            self.selected = False
        self.__visible = visible

    @property
    def img_id(self):
        return self.__img_id

    @img_id.setter
    def img_id(self, img_id):
        self.__img_id = img_id

    def setLayerPos(self, layer, pos):
        self.__layer = layer
        self.__pos = pos
        row, col = self.__pos

        if row >= 0:
            self.__x = 50 + int((self.IMAGE_W - 1) * (col / 2)) - (5 * layer)
            self.__y = 50 + int((self.IMAGE_H - 1) * (row / 2)) - (5 * layer)
        else:
            self.__x = self.IMAGE_W * -2
            self.__y = self.IMAGE_H * -2

    def is_hit(self, click_x, click_y):
        if self.visible:
            if (self.__x <= click_x) and (click_x <= (self.__x + self.IMAGE_W)):
                if (self.__y <= click_y) and (click_y <= (self.__y + self.IMAGE_H)):
                    return True
        return False

