class MahjongSolitaire():
    def __init__(self):
        tile_w = 48
        tile_h = 68
        cell_pad_x = 36
        cell_pad_y = 36
        font = 'simsun 16 bold'
        graph_w = 700
        graph_h = 650

        self.enable_mouse_click = False
        self.complete = False
        self.pattern_idx = random.randrange(0, 3)

        random.seed()

        self.layout = [[sg.Button('New Game', pad=(cell_pad_x, (cell_pad_y, 0)), font=font) ],
                       [sg.Graph(canvas_size=(graph_w, graph_h),
                        graph_bottom_left=(0, graph_h), key='Graph', pad=(0,0), enable_events=True,
                        graph_top_right=(graph_w, 0), drag_submits=True)]]

        self.window = sg.Window('Mahjong Solitaire', layout=self.layout, finalize=True)
        self.draw = self.window['Graph']

        self.board = Board()
        self.new_game()


    def new_game(self):
        self.draw.Erase()
        self.complete = False

        self.board.clear()
        self.tile_list = self.board.make_game()

        for tile in self.tile_list:
            x, y = tile.xy
            tile.img_id = self.draw.DrawImage(data=tile_imgs[tile.tile_id], location=tile.xy)

        self.select_img_id = self.draw.DrawImage(data=select_img, location=(-100, -100))


    def onclick(self, click_x, click_y):
        if self.enable_mouse_click == False:
            return

        if self.complete:
            return

        self.enable_mouse_click = False

        selected_tile = None
        for tile in self.tile_list:
            if tile.selected:
                selected_tile = tile

        is_hit = False
        hit_tile = None
        for tile in reversed(self.tile_list):
            if tile.is_hit(click_x, click_y):
                is_hit = True
                if tile.selected:
                    tile.selected = False
                    selected_tile = None
                else:
                    if self.board.can_select(tile):
                        hit_tile = tile

                        if selected_tile is None:
                            tile.selected = True
                            selected_tile = tile

                        else:
                            if selected_tile == hit_tile:
                                # Tile of the same type
                                self.board.pick_up_tile(hit_tile)
                                hit_x, hit_y = hit_tile.xy
                                self.draw.RelocateFigure(hit_tile.img_id, hit_x, hit_y)

                                self.board.pick_up_tile(selected_tile)
                                sel_x, sel_y = selected_tile.xy
                                self.draw.RelocateFigure(selected_tile.img_id, sel_x, sel_y)

                                selected_tile.selected = False
                                selected_tile = None
                break

        if not selected_tile is None and is_hit == False:
            tile.selected = False
            selected_tile = None

        if not selected_tile is None:
            sel_x, sel_y = selected_tile.xy
        else:
            sel_x, sel_y = (-100, -100)

        self.draw.RelocateFigure(self.select_img_id, sel_x, sel_y)
        self.draw.ParentForm.refresh()

        if self.board.num_tiles() == 0:
            sg.popup('complete !')
            self.complete = True

    def main_loop(self):
        while True: # Event Loop
            event, values = self.window.read(timeout=300, timeout_key='-timeout-')
            if event == sg.WIN_CLOSED:
                break

            if event == 'New Game':
                self.new_game()

            elif event in '-timeout-':
                self.enable_mouse_click = True

            elif event == 'Graph':
                click_x, click_y = values['Graph']
                self.onclick(click_x, click_y)

        self.window.close()

if __name__ == '__main__':
    sp = MahjongSolitaire()
    sp.main_loop()

